import logo from '../assets/logo.png'
import { Grid } from 'semantic-ui-react'

function Header() {
    return (
        <Grid>
            <Grid.Column></Grid.Column>           
            <img style={{width:'10%'}} src={logo} alt="gymfinder logo" />
            <div style={{color: "whitesmoke"}}>Gym Finder</div>
        </Grid>
    ) 
}

export default Header
